import ReactDOM from 'react-dom';
import './style.css'

let image = <img src="img/logo192.png"/>

ReactDOM.render(
  <div>
    <h1>Hello React !</h1>
    {image}
    <p>{}</p>
  </div>,
  document.getElementById('root')
)
